import { HashRouter as Router, Route } from "react-router-dom";
import NavigationBar from "./components/NavBar";
import HomeScreen from "./views/HomeScreen";
import Footer from "./components/Footer";
import CatalogueScreen from "./views/CatalogueScreen";
import ProductScreen from "./views/ProductScreen";
import RegisterProductScreen from "./views/RegisterProductScreen";
import ProductsListScreen from "./views/ProductsListScreen";
import LoginScreen from "./views/LoginScreen";
import "./App.css";

function App() {
  return (
    <Router>
      <NavigationBar />
      <Route path="/" component={HomeScreen} exact></Route>
      <Route path="/catalogo/" component={CatalogueScreen} exact></Route>
      <Route path="/producto/" component={ProductScreen} exact></Route>
      <Route path="/login/" component={LoginScreen} exact></Route>
      <Route
        path="admin/producto/:id/editar/"
        component={RegisterProductScreen}
        exact
      ></Route>
      <Route path="/admin/productos/"></Route>
      <Footer />
    </Router>
  );
}
export default App;
